// calculate classic style pivot point, and support and resistance values
// https://learn.bybit.com/trading/what-are-pivot-points-and-how-to-crypto-trade-with-it/
let timezone = 0    // UTC timezone offset. Enter the desired timezone offset here, eg: -4, 0, 6
