let openTimeMin = 0 // Default to 0, but can be changed to 30 for some market open times


variable.candleMaxVals.push(record.current.max)
variable.candleMinVals.push(record.current.min)
variable.candleClose = record.current.open     // need the final close value for the daily period

let datetime = new Date(record.current.begin)
let hour = datetime.getUTCHours()
let minute = datetime.getUTCMinutes()

let localTime = timezone + hour
localTime = ((localTime % 24) + 24) % 24


if (localTime == openTime && minute == openTimeMin) {
    // calculate previous day's pivot point
    let dailyHigh = Math.max(...variable.candleMaxVals)
    let dailyLow = Math.min(...variable.candleMinVals)

    variable.dailyPivot = (dailyHigh + dailyLow + variable.candleClose) / 3

    // calculate S1..S4, R1..R4
    variable.r1 = (variable.dailyPivot * 2) - dailyLow
    variable.s1 = (variable.dailyPivot * 2) - dailyHigh
    variable.r2 = variable.dailyPivot + 1 * (dailyHigh - dailyLow)
    variable.s2 = variable.dailyPivot - 1 * (dailyHigh - dailyLow)

    variable.r3 = (variable.dailyPivot * 2) + (dailyHigh - 2 * dailyLow)
    variable.s3 = (variable.dailyPivot * 2) - (2 * dailyHigh - dailyLow)
    variable.r4 = (variable.dailyPivot * 3) + (dailyHigh - 3 * dailyLow)
    variable.s4 = (variable.dailyPivot * 3) - (3 * dailyHigh - dailyLow)

    // reset data in the holding arrays
    variable.candleMaxVals.length = 0
    variable.candleMinVals.length = 0
}

